Information
------------------------------

Reign of the Dinosaurs
Combining the talent of the world's best animators, the latest paleontological research and Hollywood style storytelling Reign of the Dinosaurs illustrates the extraordinary life of dinosaurs. If you thought Dinosaurs were just over-sized, sluggish grey reptiles then think again as this brand new series drops viewers directly into the Prehistoric era and showcases the ancient world like seen never before. Presented with sparse narration, the latest cutting-edge animation and computer generated storytelling techniques; this new series features never-before-seen intimate behaviours and puts the life of dinosaurs into a whole new light.


1)  Evolutions Winners 
Everything you thought you knew about dinosaurs is wrong! In the past few decades, there has been a revolution in how scientists view dinosaurs. Recent developments in the study of dinosaur culture reveal they are much more active, complex and colourful than we ever imagined -- more like birds than sluggish reptiles. This episode highlights new discoveries that shed light on the evolution from early dinosaurs such as the tiny Eoraptor to the bizarre looking crested dinosaurs of the Jurassic to the giant carnivores such as Tyrannosaurus Rex. We'll see the mating rituals of Eoraptor and a battle between two crested Cryolophosaurs in the forests of Jurassic Antarctica. Witness the special adaptations of Gigantoraptor, a dinosaur resembling a 17-foot tall turkey with brightly colored feathers, and the huge marine reptile Mosasaurus fights off a pack of voracious sharks to protect her offspring.



